from X509_wrapper import KEY

# RSA
key = KEY.load_private_key_pem_file("files/rsa.pem.priv.key")
key = KEY.load_private_key_der_file("files/rsa.der.priv.key")
b64 = ""
key = KEY.load_private_key_base64(b64)

print(key.get_type())
print(key.get_size())
print(key.get_digest())

print(key.dump("DER"))
print(key.dump("BASE64"))
print(key.dump("PEM"))

